import Vue from 'vue'
import VueRouter from 'vue-router'
import Main from '../views/Main.vue'
import HeritageIndustry from '../views/HeritageIndustry.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',//主页面
    name: 'Main',
    component: Main,
    children: [
      {
        path: "/heritage/industry",
        component: HeritageIndustry
      },
      {
        path: "/DataMarkList",
        component: () => import('../views/DataMarkList.vue')
      },
      {
        path: "/DataManagePl",
        component: () => import('../views/DataManagePl.vue')
      },
      {
        path: "/DataUser",
        component: () => import('../views/DataUser.vue')
      },
      {
        path: "/BecauseMain",
        component: () => import('../views/BecauseMain.vue')
      },
      

      {
        path: '/AddGreenlandMap/:editid',
        component: () => import('../views/Heritage/AddGreenlandMap.vue')
      },
      {
        path: '/data/manage',
        component: () => import('../views/DataManage.vue')
      },
      // 设置
      {
        path: '/HeritageJiHe',
        component: () => import('../views/HeritageJiHe.vue')
      },
      {
        path: '/MapCheLiang',
        component: () => import('../views/MapCheLiang.vue')
      },
      // 拾取坐标位置页
      {
        path: '/get/coordinate',
        component: () => import('../views/Heritage/getCoordinate.vue')
      },
    ]
  },
  {
    path: "/heritage/login",//登陆页面
    component: () => import('../views/LoginUser.vue')
  },
]
const router = new VueRouter({
  routes
})

router.beforeEach((to, from, next) => {
  const username = sessionStorage.getItem('username')

  const isPre = sessionStorage.getItem('isOk')
  if (isPre === 'noPre') next('/noPre')
  if (to.path !== "/heritage/login" && to.path !== "/heritage/postUser" && username === null) next("/heritage/login");
  next();
})

export default router
